import React from 'react';
import PopupWithForm from './PopupWithForm';

function DeletePopup(props) {
    return (
        <PopupWithForm name="delete" title="Вы уверены?"  buttonTitle="Да"  isOpen={props.isOpen}>
        </PopupWithForm>
    )
}

export default DeletePopup;
